import React from 'react'
import '../css/components/cardProject.scss'


function CardProject({image, react, scss, node, javaScript, ror, reduxLogo, mongoLogo}) {

  const rorLogo = ror ? <img src={ror} alt="RoR Logo" className="ror-logo" width='60px'/> : null
  const redux = reduxLogo ? <img src={reduxLogo} alt="RoR Logo" className="ror-logo" width='20px'/> : null
  const mongo = mongo ? <img src={mongoLogo} alt="RoR Logo" className="ror-logo" width='20px'/> : null

  return (
    <div className='card-project'>
      <div className="project-image">
        <img src={image} alt='firstProject'></img>
      </div>
      <div className="project-infos">
        <div className="project-technologies">
        </div>
          {react}
          {scss}
          {node}
          {javaScript}
          {rorLogo}
          {redux}
          {mongoLogo}
        <div className="project-description">
          <p>Application full stack React, nodeJs</p>
        </div>
      </div>
    </div>
  )
}

export default CardProject
